import React from 'react';
import FundSubscription from './components/FundSubscription/FundSubscription';
import FundCancellation from './components/FundCancellation/FundCancellation';
import TransactionHistory from './components/TransactionHistory/TransactionHistory';
import Notification from './components/Notification/Notification';
import './App.styles.css';

/**
 * Componente principal de la aplicación.
 * Este componente es el punto de entrada de la interfaz de usuario y 
 * contiene la estructura básica para la gestión de fondos, incluyendo 
 * la suscripción a fondos, la cancelación de fondos, y el historial 
 * de transacciones.
 */
const App: React.FC = () => {
  return (
    <div className="app">
      <h1>Fund Management System</h1>
      {/* Componente de notificación que muestra un mensaje de bienvenida */}
     <Notification message="Welcome to the Fund Management System!" type="success" />
      
      {/* Componente para suscribirse a un nuevo fondo */}
      <FundSubscription />
      
      {/* Componente para cancelar una suscripción de fondo existente */}
      <FundCancellation />
      
      {/* Componente para mostrar el historial de transacciones */}
      <TransactionHistory />
    </div>
  );
};

export default App;
